const Button = ({ color, text, onClick, showAdd }) => {
  return (
    <button
      className="btn"
      style={{ backgroundColor: showAdd ? 'red' : 'green' }}
      onClick={onClick}
    >
      {text}
    </button>
  );
};

export default Button;
